// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts-upgradeable/token/ERC1155/utils/ERC1155ReceiverUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./Topx.sol";

struct Order {
  address seller;
  uint256 price;
}

contract Marketplace is Initializable, ContextUpgradeable, ERC1155ReceiverUpgradeable {

  Topx public topxInstance;

  mapping(uint256 => Order) public market;

  event OrderCreated(
    address seller,
    uint256 tokenId,
    uint256 price
  );

  event OrderBought(
    address account,
    uint256 tokenId
  );

  event OrderCanceled(
    uint256 tokenId
  );

  function initialize(Topx _topxInstance) external initializer {
    topxInstance = _topxInstance;
  }

  event MarketplaceEthTransfer(uint8 _action, uint256 _tokenId, uint256 _amount, address _from, address _to);

  function buyOrder(uint256 _tokenId) external payable {
    Order memory order = market[_tokenId];
    require(order.seller != address(0x0), "There are no open orders for that token");
    address sender = _msgSender();
    // get royalty info
    address creator;
    address artist;
    address platform;
    uint256 creatorRoyalty;
    uint256 artistRoyalty;
    uint256 platformRoyalty;
    uint256 upfrontRoyalty;
    (creator, artist, platform, creatorRoyalty, artistRoyalty, platformRoyalty, upfrontRoyalty) = topxInstance.getRoyaltyInfo(_tokenId, order.price);
    // validate
    require(msg.value >= order.price + upfrontRoyalty, "Value less than price");
    // calc
    uint256 fullPlatformRoyalty = upfrontRoyalty + platformRoyalty;
    uint256 fullSeller = msg.value - creatorRoyalty - artistRoyalty - fullPlatformRoyalty;
    // logs
    emit MarketplaceEthTransfer(1, _tokenId, creatorRoyalty, sender, creator);
    emit MarketplaceEthTransfer(2, _tokenId, artistRoyalty, sender, artist);
    emit MarketplaceEthTransfer(4, _tokenId, fullPlatformRoyalty, sender, platform);
    emit MarketplaceEthTransfer(3, _tokenId, fullSeller, sender, order.seller);
    // close and transfer
    delete market[_tokenId];
    emit OrderBought(_msgSender(), _tokenId);
    // transfers
    payable(creator).transfer(creatorRoyalty);
    payable(artist).transfer(artistRoyalty);
    payable(platform).transfer(fullPlatformRoyalty);
    payable(order.seller).transfer(fullSeller);
    topxInstance.safeTransferFrom(address(this), sender, _tokenId, 1, '0x');
  }

  function cancelOrder(uint256 tokenId) external {
    require(market[tokenId].seller != address(0x0), "There are no open orders for that token");
    Order memory order = market[tokenId];
    address sender = _msgSender();
    require(order.seller == sender);
    delete market[tokenId];
    emit OrderCanceled(tokenId);
    topxInstance.safeTransferFrom(address(this), sender, tokenId, 1, '0x');
  }

  function addOrder(uint256 tokenId, uint256 price) external {
    require(market[tokenId].seller == address(0x0), "There already is an open order for that token");
    address sender = _msgSender();
    market[tokenId] = Order(sender, price);
    emit OrderCreated(sender, tokenId, price);
    topxInstance.safeTransferFrom(sender, address(this), tokenId, 1, '0x');
  }

  function getOrder(uint256 tokenId) external view returns ( address, uint256 ) {
    require(market[tokenId].seller != address(0x0), "There are no open orders for that token");
    Order memory order = market[tokenId];
    return (order.seller, order.price);
  }

  function onERC1155Received(
    address operator,
    address from,
    uint256 id,
    uint256 value,
    bytes calldata data
  ) external override pure returns (bytes4) {
    return (
      bytes4(
        keccak256(
          "onERC1155Received(address,address,uint256,uint256,bytes)"
        )
      )
    );
  }

  function onERC1155BatchReceived(
    address operator,
    address from,
    uint256[] calldata ids,
    uint256[] calldata values,
    bytes calldata data
  ) external override pure returns (bytes4) {
    revert();
    return "";
  }   
}
